    this.state = {};
  }
  render() {
    return (
    <div className="">
      <ul>
      	<li>
				<a href="#gambar-3">
					<img src="https://www.dropbox.com/s/uwn8jbr7lc6lj2n/thor.png?raw=1" alt="Thor"/>
					<span>Thor</span>
				</a>

				<div class="overlay" id="gambar-3">
					<a href="#" class="close">x close</a>
					<img src="https://www.dropbox.com/s/qyfr2cfn3hpx3il/thor.png?raw=1" alt="Thor"/>
				</div>
			</li>
      </ul>
</div>
    );
  }
}

export default ChatRoom;
